import React from 'react'
import styled from "styled-components"
function Card({post}) {
    return (
        <Container>
        <Wrap>
          <span>{post.title}</span>
          <img src={post.img}></img>
          <p>{post.desc}</p>
          <button>Read More</button>
        </Wrap>
        </Container>
    )
}

export default Card
const Container=styled.div`
width:100 %;
height:100;


`
const Wrap=styled.div`
width:30%;

img{
    width:100%;
}
`
